import React from "react";

const SelectButton = () => {
  return (
    <React.Fragment>
      <button>강남구</button>
      <button>강북구</button>
      <button>노원구</button>
      <button>동대문구</button>
      <button>동작구</button>
      <button>마포구</button>
      <button>송파구</button>
      <button>용산구</button>
    </React.Fragment>
  );
};

export default SelectButton;
